define("model/participant-collection",["backbone-brace","underscore","model/participant"],function(C,A,B){return C.Collection.extend({model:B,comparator:function(E,D){return(E.getApproved()===D.getApproved())?(E.getUser().getDisplayName()).localeCompare(D.getUser().getDisplayName()):E.getApproved()?-1:1},findByUser:function(D){return A.find(this.models,function(E){return E.getUser().getName()===D.getName()})}})});